from aiogram import F, Botfrom aiogram.fsm.state import StatesGroup, Statefrom aiogram.types import CallbackQuery, FSInputFilefrom aiogram.utils.keyboard import InlineKeyboardBuilderfrom database import Userfrom database.models.users import DocumentTypefrom handlers.admin.base import AdminCallbackfrom handlers.routers import admin_router@admin_router.callback_query(AdminCallback.filter(F.action == 'user_verification'))async def get_user_verification(call: CallbackQuery, callback_data: AdminCallback, bot: Bot):    user = await User.find_one(User.user_id == callback_data.user_id)    if user:        markup = InlineKeyboardBuilder()        markup.button(            text='Пройти верификацию', callback_data='verification'        )        file = FSInputFile('files/info.png')        send = await bot.send_photo(            photo=file,            chat_id=callback_data.user_id,            caption='<b>⚠️ ВНИМАНИЕ ⚠️</>\n\n'                    'Администрация сняла с вас верификацию и запросила повторную верификацию!',            reply_markup=markup.adjust(1).as_markup()        )        if send:            await call.answer('Запрос на повторную верификацию отправлен пользователю!', True)        else:            await call.answer('Произошла ошибка при отправке уведомления пользователю!', True)